  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Shiawasee National
  Wildlife Refuge outlines Refuge accomplishments from May - August 1963. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses plantings. The public relations section of the
  report describes recreational uses, Refuge visitors, Refuge participation, hunting,
  and violations. Items of interest, photographs and N-R forms are attached.\",\n\t\"owner_org\":
